svg.script:
window.onload = function() {
	const cursor = document.getElementById("cursor");
	const pointerCursor = document.getElementById("pointerCursor");
	const textCursor = document.getElementById("textCursor");
	const handCursor = document.getElementById("hand");
	const caret = document.getElementById("caret");
	const caretGroup = document.getElementById("caretGroup");
	const caretLeft = document.getElementById("caretLeft");
	const shadow = document.getElementById("shadow");
	const searchPage = document.getElementById("searchPage");
	const foodButtonInSearchBackground = document.getElementById("foodButtonInSearchBackground");
	const foodButtonInSearch = document.getElementById("foodButtonInSearch");
	const animatedGraph = document.getElementById("animatedGraph");
	const foodLine = document.getElementById("foodLine");
	const numbers = document.getElementById("numbers");
	const rightButtonHover = document.getElementById("rightButtonHover");
	const rightButton = document.getElementById("rightButton");

	function resetStage () {
		cursor.classList.remove("toTmrwButton");
		handCursor.classList.remove("visible", "click");
		rightButton.classList.remove("click");
		animatedGraph.classList.remove("reduced");
		numbers.classList.remove("reduced");
		foodLine.classList.remove("visible");
		rightButtonHover.classList.remove("visible");
		foodButtonInSearch.classList.remove("click");
		foodButtonInSearchBackground.classList.remove("click", "hover");
		pointerCursor.classList.add("visible");

		window.setTimeout(firstScene, 2500);
	}

	function fourthScene() {
		const phase1StartTime = 2000;
		const phase2StartTime = phase1StartTime + 1330;
		const phase3StartTime = phase2StartTime + 1500;
		const phase4StartTime = phase3StartTime + 900;
		const phase5StartTime = phase4StartTime + 800;
		const phase6StartTime = phase5StartTime + 700;
		caretGroup.classList.remove("caretTyping");
		caretLeft.classList.remove("hidden");
		searchPage.classList.remove("visible");
		cursor.classList.remove("toFoodButton");

		window.setTimeout(() => {
			shadow.classList.remove("visible");
		}, 500);

		window.setTimeout(() => {
			foodLine.classList.add("visible");
		}, phase1StartTime);

		window.setTimeout(() => {
			animatedGraph.classList.add("reduced");
			numbers.classList.add("reduced");
		}, phase2StartTime);

		window.setTimeout(() => {
			cursor.classList.add("toTmrwButton");
		}, phase3StartTime);

		window.setTimeout(() => {
			pointerCursor.classList.remove("visible");
			handCursor.classList.add("visible");
			rightButtonHover.classList.add("visible");
		}, phase4StartTime);

		window.setTimeout(() => {
			rightButton.classList.add("click");
		}, phase5StartTime);

		window.setTimeout(resetStage, phase6StartTime);
	}

	function thirdScene() {
		const phase1StartTime = 2000;
		const phase2StartTime = phase1StartTime + 600;
		const phase3StartTime = phase2StartTime + 1000;
		const phase4StartTime = phase3StartTime + 1000;
		shadow.classList.add("visible");
		searchPage.classList.add("visible");

		window.setTimeout(() => {
			textCursor.classList.remove("visible");
			pointerCursor.classList.add("visible");
			cursor.classList.remove("toTextInput");
			cursor.classList.add("toFoodButton");
		}, phase1StartTime);

		window.setTimeout(() => {
			pointerCursor.classList.remove("visible");
			handCursor.classList.add("visible");
			foodButtonInSearchBackground.classList.add("hover");
		}, phase2StartTime);

		window.setTimeout(() => {
			handCursor.classList.add("click");
			foodButtonInSearch.classList.add("click");
			foodButtonInSearchBackground.classList.add("click");
		}, phase3StartTime);

		window.setTimeout(fourthScene, phase4StartTime);
	}

	function secondScene() {
		const startTime = 3000;
		const typingAnimationTime = 1000;
		window.setTimeout(() => {
			caret.classList.remove("blinking");
			caret.classList.add("visible");
			caretGroup.classList.add("caretTyping");
		}, 3000);

		window.setTimeout(() => {
			caretLeft.classList.add("hidden");
		}, (startTime + typingAnimationTime / 2));

		window.setTimeout(() => {
			caret.classList.remove("visible");

			thirdScene();
		}, (startTime + typingAnimationTime));
	}

	function firstScene() {
		cursor.classList.add("toTextInput");

		window.setTimeout(() => {
			pointerCursor.classList.remove("visible");
			textCursor.classList.add("visible");
		}, 1200 * .6);

		window.setTimeout(() => {
			caret.classList.add("blinking");
			secondScene();
		}, 1200);
	}

	firstScene();
};
